import 'whatwg-fetch';
import "./style.css";
import { NavBar } from './components/NavBar';


// render every component for the website
export default class App extends Component {
    render() {        
        return (
            <div>
                <NavBar />
                <Header />
                <Main />
                <Footer />
            </div>
        )
    }
}
